Consider a simple function that takes in an array of floats $a$, and adds 1 to each element, storing its output in $b$: void add_1(float * a, float *b, int N){ for (int i = 0; i < N; i++){ b[i] = a[i] + 1; }
} To perform 2 to elements to an array, we can simply call add_1 twice: float * a = (float *) malloc(N * sizeof(float)) float * b = (float *) malloc(N * sizeof(float)) float * c = (float *) malloc(N * sizeof(float)) add_1(b, a, N); add_1(c, b, N); or, we can implement a special add_2 function: void add_2(float * a, float *b, int N){ for (int i = 0; i < N; i++){ b[i] = a[i] + 2; }
} and simply call it: float * a = (float *) malloc(N * sizeof(float)) float * c = (float *) malloc(N * sizeof(float)) add_2(c, a, N); The add_2 function not only uses less memory, requiring no allocation for an intermediate, it also takes advantage of locality . Each float is loaded once and all operations are applied immediately, when the data is ready. This technique of applying a sequence of operations back-to-back on susbets of data rather than computing entire intermediate outputs is called operator fusion . Traditionally, your favorite compiler runs a fusion pass, bringing computations into the same outer-loop scope when it can determine that the transformation is correct. While these passes typically fuse at single data element granularity, one can also generalize this idea to instead think about fusion happening at different granularities (4 elements, 8 elements, tiles of data, etc.).
